import React from 'react';
import './App.css';
import { HashRouter, Switch, Route, Redirect, NavLink } from 'react-router-dom';
import { Menu } from 'antd';
import {
  MailOutlined,
  AppstoreOutlined,
  SettingOutlined,
} from '@ant-design/icons';

const { SubMenu } = Menu;
const links = ['Input', 'Task List'];
function App() {
  state = {
    current: 'mail',
  };

  handleClick = (e) => {
    console.log('click ', e);
    this.setState({
      current: e.key,
    });
  };
  return (
    <HashRouter>
      <header />
      <nav>
        <div>
          <Menu
            onClick={handleClick}
            selectedKeys={[state.current]}
            mode="horizontal"
          >
            {links.map((link) => (
              <Menu.Item
                className="headerLink"
                key={link}
                to={link}
                icon={<MailOutlined />}
              >
                {link}
              </Menu.Item>
            ))}
          </Menu>
        </div>
      </nav>
      <div className="app">
        <Switch>
          <Route render={() => <Redirect to="/Rooms" />} />
        </Switch>
      </div>
    </HashRouter>
  );
}

export default App;
